$_MODULE['<{facebookpsconnect}ecosapin-v2>system-health-settings_1d8dc2484c575a929a466a138cc541e6'] = 'Qui sotto puoi vedere se i moduli sono installati sul tuo shop e se hanno la versione minima richiesta. Se non li hai ancora acquistati, sarà incluso un link verso PrestaShop (per chi non ordina abitualmente sul nostro shop, si possono trovare sopra). Se li hai già acquistati ma non hai la versione minima richiesta, dovrai scaricare l\'ultima versione dal tuo account Addons o Business Tech, rubrica Cronologia degli ordini, purché tu abbia selezionato l\'opzione di aggiornamento sufficiente all\'acquisto del modulo. Altrimenti, dovrai riaquistarlo.';
